searchIndex['unidecode'] = {"items":[[0,"","unidecode","The `rust-unidecode` library is a Rust port of Sean M. Burke's famous\n[`Text::Unidecode`](http://search.cpan.org/~sburke/Text-Unidecode-1.23/lib/Text/Unidecode.pm)\nmodule for Perl. It transliterates Unicode strings such as \"Æneid\" into pure\nASCII ones such as \"AEneid.\" For a detailed explanation on the rationale\nbehind using such a library, you can refer to both the documentation of the\noriginal module and\n[this article](http://interglacial.com/~sburke/tpj/as_html/tpj22.html)\nwritten by Burke in 2001.",null,null],[5,"unidecode","","This function takes any Unicode string and returns an ASCII transliteration\nof that string.",null,{"inputs":[{"name":"str"}],"output":{"name":"string"}}],[5,"unidecode_char","","This function takes a single Unicode character and returns an ASCII\ntransliteration.",null,{"inputs":[{"name":"char"}],"output":{"name":"str"}}]],"paths":[]};
